import React, { useState,useEffect  } from 'react';
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './index.css';
import Hello from "./pages/hello";
import Hello2 from "./pages/hello2";
import Contacts from "./pages/contacts";
import Clicker from "./pages/clicker";
import Counter from "./pages/counter";
import Home from "./pages/Home";
import Menu from "./pages/PizzaMenu";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Profile from "./pages/Profile";
import AddPizza from "./pages/AddPizza";
function App() {

  const [loggedInUser, setLoggedInUser] = useState(null);

  const handleLogin = (user) => {
      setLoggedInUser(user);
      localStorage.setItem('loggedInUser', JSON.stringify(user));
  };

  const handleLogout = () => {
      setLoggedInUser(null);
      localStorage.removeItem('loggedInUser');
  };

  useEffect(() => {
    const storedUser = localStorage.getItem('loggedInUser');
    if (storedUser) {
      setLoggedInUser(JSON.parse(storedUser));
    }
  }, []);


return (
<Router>

<div>
        <header>
          <center><h1>Pizzernia</h1></center>
          <div class="header-buttons">
          {!loggedInUser && <Link to="/login" class="menuButton">Logowanie</Link>}
          {!loggedInUser && <Link to="/register" class="menuButton">Rejestracja</Link>}
          {loggedInUser && <button class="menuButton" onClick={handleLogout}>Wyloguj</button>}
          {loggedInUser && loggedInUser.username === 'admin' && <Link to="/profile" class="menuButton">Mój Profil</Link>}
          </div>

        </header>
        <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/menu">Menu</Link></li>
            </ul>
          </nav>  

        <article>

            <Routes>
            <Route path="/" element={<Home/>}/>
            <Route path="/menu" element={<Menu nazwa={loggedInUser} />}/>
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login onLogin={handleLogin} />} />
            <Route path="/profile" element={<Profile user={loggedInUser} />} />
            <Route path="/addpizza" element={<AddPizza />} />

            <Route path="/hello2" element={<Hello2 title="Jan" content="Hello!"/>}/>
            <Route path="/contacts" element={<Contacts/>}/>
            <Route path="/clicker" element={<Clicker/>}/>
            <Route path="/counter" element={<Counter/>}/>
            </Routes>


 </article>
 </div>
 </Router>
 ); }
ReactDOM.render(<App />, document.getElementById("root"));
